    var recipes = [hoodRecipes,jacketRecipes,shoesRecipes,offhandRecipes,bowRecipes,spearRecipes,natureRecipes,daggerRecipes,quarterstaffRecipes]

    var itemmap = new Item_Map()

    async function updateTable(){
      updateButtonTextUpdating()
      itemmap.clearMap()
      updateItemMap(itemmap,appendItems([materials,fey])).then(x => updateItemMap(itemmap, artefact1)).then(x => updateItemMap(itemmap, appendItems([armor1, offhand]))).then(x => updateItemMap(itemmap, armor2))
      .then(x => updateItemMap(itemmap, weapon1)).then(x => updateItemMap(itemmap, weapon2)).then(x => updateItemMap(itemmap, enchant4))
      .then(x => updateTableValues()).then(x => updateButtonTextUpdated())
    }

    async function updateTableValues(){
      createTableFromRecipesDifferentEnd(recipes[$("#category").val()], itemmap)
      updateProfit()
      changeProfitColor()
      showOnlyEnchant($("#enchantLevel").val())
      bindSelectRow()
    }

    $(document).ready(function(){
      createNavBar()
      updateTable()
      $("#category").change(function() { updateTableValues() })
      $("#quality").change(function() { updateTableValues() })
      $("#enchantLevel").change(function() { updateTableValues() })
      $("#locations").change(function() { updateTableValues() })
      $("#endLocations").change(function() { updateTableValues() })
    })